class DashboardComponent {
    constructor(route, infoService) {
        this.route = route;
        this.infoService = infoService;
        this.error = '';
        this.success = '';
        this.selected = '';
        this.editItem = '';
    }
    ngOnInit() {
        this.getAll();
    }
    getAll() {
        this.infoService.getAll().subscribe((res) => {
            this.information = res;
        }, (err) => {
            this.error = err;
        });
    }
    addInfo(title, template) {
        title = title.trim();
        this.infoService.addInfo(title, template)
            .subscribe((res) => {
            this.information = res;
            this.success = title + ' Created Successfully';
        }, (err) => this.error = err);
    }
    updateInfo(title) {
        const infos = this.infoService.cloneInfo(this.information);
        for (let c in infos) {
            if (infos[c]["title"] == this.editItem) {
                infos[c]["title"] = title;
                this.infoService.updateInfo(infos[c])
                    .subscribe((res) => {
                    this.information[c] = res;
                    this.success = 'Updated successfully';
                }, (err) => this.error = err);
            }
        }
    }
    deleteInfo(id) {
        this.infoService.deleteInfo(id)
            .subscribe((res) => {
            this.information = res;
            this.success = 'Deleted Successfully';
        }, (err) => this.error = err);
    }
    selectListItem(item) {
        console.log(item, " - ", this.selected, "/", this.editItem);
        if (this.selected == item) { //Item selected 2nd time
            this.editItem = item;
            this.selected = "";
        }
        else {
            this.selected = item;
        }
    }
}
